<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <title>Classificação de Imagem com TensorFlow.js</title>
    <script src="https://cdn.jsdelivr.net/npm/@tensorflow/tfjs"></script>
    <script src="https://cdn.jsdelivr.net/npm/@tensorflow-models/mobilenet"></script>
    <style>
        body {
            font-family: Arial, sans-serif;
            text-align: center;
            margin: 50px;
        }
        #input-image {
            display: block;
            margin: 20px auto;
        }
        #prediction {
            margin-top: 20px;
        }
        .image-preview {
            margin: 10px;
            border: 2px solid #ddd;
            padding: 5px;
            display: inline-block;
        }
        .prediction-result {
            font-size: 1.2em;
            color: #333;
        }
        .hidden {
            display: none;
        }
    </style>
</head>
<body>
    <h1>Classificação de Imagem com TensorFlow.js</h1>
    <input type="file" id="input-image" accept="image/*">
    <div id="image-preview-container"></div>
    <div id="prediction" class="hidden"></div>
    <script>
        // Função para carregar o modelo MobileNet
        async function loadModel() {
            const model = await mobilenet.load();
            return model;
        }

        // Função para realizar a predição
        async function predict(model, imageElement) {
            const predictions = await model.classify(imageElement);
            return predictions;
        }

        // Carregar o modelo assim que a página for carregada
        let model;
        window.onload = async () => {
            model = await loadModel();
            document.getElementById('prediction').innerText = "Modelo carregado. Faça upload de uma imagem para classificação.";
        };

        // Função para criar um preview da imagem
        function createImagePreview(file) {
            const imageContainer = document.createElement('div');
            imageContainer.className = 'image-preview';
            const imageElement = document.createElement('img');
            imageElement.src = URL.createObjectURL(file);
            imageElement.onload = async () => {
                const predictions = await predict(model, imageElement);
                displayPredictions(predictions, imageContainer);
            };
            imageContainer.appendChild(imageElement);
            document.getElementById('image-preview-container').appendChild(imageContainer);
        }

        // Função para exibir as predições
        function displayPredictions(predictions, container) {
            const predictionContainer = document.createElement('div');
            predictionContainer.className = 'prediction-result';
            predictionContainer.innerText = JSON.stringify(predictions, null, 2);
            container.appendChild(predictionContainer);
        }

        // Manipulador de evento para o input de imagem
        document.getElementById('input-image').addEventListener('change', async (event) => {
            const files = event.target.files;
            for (const file of files) {
                createImagePreview(file);
            }
        });
